import { Test, TestingModule } from '@nestjs/testing';
import { INestApplication } from '@nestjs/common';
import * as request from 'supertest';
import { AppModule } from '../../src/app.module';

describe('AppController (e2e)', () => {
  let app: INestApplication;
  let measureId: string;

  beforeEach(async () => {
    const moduleFixture: TestingModule = await Test.createTestingModule({
      imports: [AppModule],
    }).compile();

    app = moduleFixture.createNestApplication();
    await app.init();
  });

  describe('POST /upload tests', () => {
    test('/upload happy way', async () => {
      const uploadedMeasure = {
        image:
          '',
        custumer_code: '12345',
        measure_datetime: '2024-07-28',
        measure_type: 'GAS',
      };

      const result = await request(app.getHttpServer())
        .post('/upload')
        .send(uploadedMeasure);

      measureId = result.body.measure_uuid;

      expect(result.statusCode).toBe(201);
      expect(result).toHaveProperty('image_url');
      expect(result).toHaveProperty('measure_value');
      expect(result).toHaveProperty('measure_uuid');

      // await request(app.getHttpServer()).delete(
      //   `/delete/${result.body.measure_uuid}`,
      // );
    });

    test('/upload doble report exception', async () => {
      const uploadedMeasure = {
        image:
          '',
        custumer_code: '12345',
        measure_datetime: '2024-07-30',
        measure_type: 'GAS',
      };

      await request(app.getHttpServer())
        .post('/upload')
        .send(uploadedMeasure)
        .expect(409);
    });

    test('/upload custumer_code validation exception', async () => {
      const uploadedMeasure = {
        image:
          '',
        measure_datetime: '2024-09-30',
        measure_type: 'WATER',
      };

      const result = await request(app.getHttpServer())
        .post('/upload')
        .send(uploadedMeasure);

      expect(result.statusCode).toBe(400);
    });

    test('/upload datetime validation exception', async () => {
      const uploadedMeasure = {
        image:
          '',
        custumer_code: '54321',
        measure_datetime: 'data',
        measure_type: 'WATER',
      };

      const result = await request(app.getHttpServer())
        .post('/upload')
        .send(uploadedMeasure);

      expect(result.statusCode).toBe(400);
    });

    test('/upload measure type validation exception', async () => {
      const uploadedMeasure = {
        image:
          '',
        custumer_code: '54321',
        measure_datetime: '2024-08-30',
        measure_type: 'agua',
      };

      const result = await request(app.getHttpServer())
        .post('/upload')
        .send(uploadedMeasure);

      expect(result.statusCode).toBe(400);
    });
  });

  describe('PATCH /confirm tests', () => {
    test('/confirm not found exception', async () => {
      const confirmRequest = {
        measure_uuid: 'fa1e4ce5-8aa9-4acd-8ad6-a3ade909cea5',
        confirmed_value: 308.591,
      };

      const result = await request(app.getHttpServer())
        .patch('/confirm')
        .send(confirmRequest);

      expect(result.statusCode).toBe(404);
    });

    test('/confirm bad request exception', async () => {
      const confirmRequest = {
        measure_uuid: 'id_invalido',
        confirmed_value: 308.591,
      };

      const result = await request(app.getHttpServer())
        .patch('/confirm')
        .send(confirmRequest);

      expect(result.statusCode).toBe(400);
    });

    test('/confirm happy way', async () => {
      const confirmRequest = {
        measure_uuid: measureId,
        confirmed_value: 358.941,
      };

      const result = await request(app.getHttpServer())
        .patch('/confirm')
        .send(confirmRequest)
        .expect(200);

      expect(result).toHaveProperty('success');
    });

    test('/confirm doble report exception', async () => {
      const confirmRequest = {
        measure_uuid: measureId,
        confirmed_value: 358.941,
      };

      const result = await request(app.getHttpServer())
        .patch('/confirm')
        .send(confirmRequest);

      expect(result.statusCode).toBe(409);
    });
  });

  describe('GET /:custumer_code/list tests', () => {
    test('/:custumer_code/list happy way without type', async () => {
      const result = await request(app.getHttpServer())
        .get('/12345/list')
        .expect(200);

      expect(result).toBeInstanceOf('object');
    });

    test('/:custumer_code/list happy way with type', async () => {
      const result = await request(app.getHttpServer())
        .get('/12345/list?measure_type=gas')
        .expect(200);

      expect(result).toBeInstanceOf('object');
    });

    test('/:custumer_code/list not found exception without type', async () => {
      const result = await request(app.getHttpServer())
        .get('/54321/list')
        .expect(404);
    });

    test('/:custumer_code/list not found exception with type', async () => {
      const result = await request(app.getHttpServer())
        .get('/12345/list?measure_type=water')
        .expect(404);
    });

    test('/:custumer_code/list with invalid type', async () => {
      const result = await request(app.getHttpServer())
        .get('/12345/list?measure_type=agua')
        .expect(404);
    });
  });
});
